      <div className="nav-container">
          <Navbar />
          <Routes>
            <Route path='/' exact element={<Home />}/>
            <Route path='/reports' element={<Reports />}/>
            <Route path='/visualise' element={<Visualise />}/>
            <Route path='/settings' element={<Settings />}/>
          </Routes>
      </div>
    </Router>  
  );
}

export default App;
